const Hello = () => {
  return (
    <div>
      <p>Hello</p>
    </div>
  );
};

const App = () => {
  const now = new Date().toISOString();
  return (
    <div>
      <h1>Greetings</h1>
      <Hello />
      <p>{now}</p>
    </div>
  );
};

export default App;
